  function handlePaste(e, idx) {
    e.preventDefault();
    var paste = (e.clipboardData || window.clipboardData).getData('text');
    if (!paste) return;
    var chars = paste.toUpperCase().replace(/[^A-Z0-9]/g, '').split('');
    for (var i = 0; i < chars.length && idx + i < LENGTH; i++) {
      inputs[idx + i].value = chars[i];
    }
    var next = Math.min(LENGTH - 1, idx + chars.length);
    inputs[next].focus();
    checkFilled();
  }
  inputs.forEach(function (input, i) {
    // На фокус — убрать placeholder визуально (браузер делает это, но мы явно)
    input.addEventListener('focus', function () {
      // выделяем текст, чтобы при вводе заменялось
      input.select();
    });

    // Вставка
    input.addEventListener('paste', function (e) {
      return handlePaste(e, i);
    });

    // Ввод символа
    input.addEventListener('input', function (e) {
      var v = cleanChar(input.value);
      input.value = v;
      if (v && i < LENGTH - 1) {
        inputs[i + 1].focus();
        inputs[i + 1].select();
      }
      checkFilled();
    });

    // Навигация клавишами
    input.addEventListener('keydown', function (e) {
      if (e.key === 'Backspace') {
        if (input.value === '') {
          // если пусто — переходим в предыдущее и очищаем его
          if (i > 0) {
            inputs[i - 1].focus();
            inputs[i - 1].value = '';
            e.preventDefault();
            checkFilled();
          }
        } else {
          // если есть символ — очистим текущий
          input.value = '';
          e.preventDefault();
          checkFilled();
        }
      } else if (e.key === 'ArrowLeft') {
        if (i > 0) {
          inputs[i - 1].focus();
          inputs[i - 1].select();
          e.preventDefault();
        }
      } else if (e.key === 'ArrowRight') {
        if (i < LENGTH - 1) {
          inputs[i + 1].focus();
          inputs[i + 1].select();
          e.preventDefault();
        }
      } else if (e.key.length === 1) {
        // позволяем обычные символы — обработка будет в input
      } else if (e.key === 'Enter') {
        // можно сабмитнуть, если заполнено
        if (checkFilled().length === LENGTH) {
          document.getElementById('promo-form').dispatchEvent(new Event('submit', {
            cancelable: true
          }));
        }
      }
    });

    // При клике — ставим фокус в это поле и выделяем содержимое
    input.addEventListener('click', function () {
      input.focus();
      input.select();
    });
  });

  // submit
  document.getElementById('promo-form').addEventListener('submit', function (e) {
    e.preventDefault();
    var code = inputs.map(function (i) {
      return i.value;
    }).join('');
    if (code.length !== LENGTH) return;
    // здесь можно заменить на fetch/ajax отправку
    alert('Код зарегистрирован: ' + code);
    inputs.forEach(function (i) {
      return i.value = '';
    });
    inputs[0].focus();
    checkFilled();
  });

